import React, {useEffect} from "react";
import { Card, Col, Row } from "react-bootstrap";

function AnnouncementCard({announcement}) {
    return (
        <Card className="mb-4 announcement" style={{ width:"400px", margin:"10px"}}>
            <Row>
                <Col md={4} className="text-center">
                    <Card.Img variant="top" src="data:image/png;base64,"/>
                    <Card.Text>Current rating: {announcement.rate}/5 &#x2605;</Card.Text>
                </Col>
                <Col md={8}>
                    <Card.Body>
                        <Card.Title>{announcement.title}</Card.Title>
                        <Card.Text>{announcement.description}</Card.Text>
                    </Card.Body>
                    <Card.Footer className="text-end">
                        <small className="text-muted">
                            {announcement.startDate} - {announcement.endDate}
                        </small>
                    </Card.Footer>
                </Col>
            </Row>
        </Card>
    );
}

export default AnnouncementCard;
